import About from "./Components/About";
import Child from "./Components/About/Child";
import Cal from "./Components/Contact/Cal";
import Contact from "./Components/Contact/Contact";
import Effect from "./Components/Myhook/Effect";
import EffectWithParams from "./Components/Myhook/EffectWithParams";
import Myhook from "./Components/Myhook/Myhook";
import Service from "./Components/Contact/Service";

import Home from "./Components/Home";

import EffectCleanup from "./Components/Myhook/EffectCleanup";





function App() {
  const clickbutton=()=>{//le props comme une fonction
    console.log("je suis un composant");
  }


  return (
    <div className="App">
      <p>projet react</p>
      <Home></Home>
      <Contact></Contact>
      <Service />
      <About name={'Houda'} age={25} />

      <Cal nbr1={30}  nbr2={10}/>
      <Child btn={clickbutton}/>
      <Myhook />


   <EffectWithParams />
  <EffectCleanup></EffectCleanup>




    </div>
  );
}

export default App;
